                            </li>
                        </ul>
                        <ul class="nav navbar-nav w-100 justify-content-end">
                            <li class="nav-item">
                                <button 
                                    style={{marginRight: "6px"}}
                                    class="btn btn-outline-primary" href="#">Patient
                                </button>                            
                            </li>
                            <li class="nav-item" style={{color: 'black'}}>
                                <button 
                                    style={{marginRight: "6px"}}
                                    class="btn btn-outline-primary" href="#">Physician
                                </button>
                            </li>
                        </ul>
                    </div>
                </nav></>

